        <div>
            <img src='moi.png'
                className="py-16 pl-4" />
            <div className='text-2xl text-center'>오늘 날씨에 뭐입지?</div>
            <div className='text-2xl text-center'>모이가 알려드릴게요!</div>
            <div className="border-2 border-black"></div>

        </div>
    );
};
